public static List<String> magicPathChildren(List<String> elements) {
  int index = magicElementIndex(elements);
  int len = elements.size();
  if (index == len - 1) {
    // empty index
    return Collections.emptyList();
  } else {
    return elements.subList(index + 1, len);
  }
}
